pub fn get_vertica_root_grammar_id() -> GrammarId {
    GrammarId(2043)
}
pub fn get_vertica_root_grammar_table() -> RootGrammar {
    RootGrammar {
        grammar_id: get_vertica_root_grammar_id(),
        tables: &VERTICA_TABLES,
    }
}
pub fn get_vertica_root_grammar() -> RootGrammar {
    get_vertica_root_grammar_table()
}
